import React, { Component } from "react";
import { Nav, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";

export default class ProjectSummaryHeader extends Component {
  render() {
    return (
      <div>
        <Navbar expand="lg" bg="light">
          {/* <Navbar.Text>*/}
            &nbsp; <strong> 
              <Navbar.Text as={Link} to="/home" style={{ textDecoration: 'none' }}>Dashboard </Navbar.Text> / <Navbar.Text component={Link} to="/projects" style={{ textDecoration: 'none' }}>Projects</Navbar.Text> / Project Summary
              </strong>
          {/* </Navbar.Text> */}
        </Navbar>
      </div>
    );
  }
}
